import React from 'react'
import { Route, Router } from 'react-router-dom'
import AuthLayout from './pages/Auth/AuthLayout'

export default function App() {
  return (
    <div>
      <Route>
        <Route path='/auth/*' element={<AuthLayout />} />
      </Route>
    </div>
  )
}
